;;; 
;;; ## Executable segments
;;; 
;;; Executable code is written in Clojure. There are several renderers for visualizing computational results. Library resources mut be imported before they can be used. For example, the following code imports the **`gorilla-plot`** library and demos the **`list-plot`** function. 
;;; 
;;; _Shift + enter evaluates code._ 
;; **

;; @@
(use 'gorilla-plot.core)
(def d
  [1 3 5 7 9 5 4 6 9 8 3 5 6])
(list-plot d)
