;; **
;;; ## Commands
;;; 
;;; Press ctrl+g twice in quick succession or click the menu icon (upper-right corner) for an overview on commands.
;; **

;; **
;;; ## Using @@GRAPE@@
;;; 
;;; Similar to the above example, **the @@GRAPE@@ library must be imported** before it can be used. Under the hood, @@GRAPE@@ connects to the graph database NEO4J so the `(use 'grape.core')` may take a few seconds.
;; **

;; @@
(use 'grape.core)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; 
;; **

;; **
;;; ## Graphs and graph persistence
;;; 
;;; @@GRAPE@@ supports arbitrarily many graphs as [fully persistent data structures](https://en.wikipedia.org/wiki/Persistent_data_structure), i.e., _all_ versions of a graph can be accessed and modified.
;;; 
;;; A new (empty) graph is created using the `(newgraph)` function. Graphs are identified with a unique hash id.
;; **

;; @@
(newgraph)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-string'>&quot;e1dce094-cda7-4e31-8144-bcb8611a9a3e&quot;</span>","value":"\"e1dce094-cda7-4e31-8144-bcb8611a9a3e\""}
;; <=

;; **
;;; ## Graph production rules
;;; 
;;; Graph production rules are defined in _hybrid_ language (textual input with graphical view). There are three example rules below. 
;;; 
;;; 1. The first rule (**`hello`**) creates a new node of type _Hello_
;;; 1. The second rule (**`world`**) looks for an existing node of type `Hello` and connects it with a new node of type `World`.
;;; 2. The third rule (**`world`**) looks for two nodes of type `Hello` and `World`, respectively, which are connected with a `to` edge and replaces the `World` node with a node of type `Grape`. 
;; **

;; @@
(rule 'hello 
   :create (pattern 
             (node :label "Hello")))

(rule 'world 
   :read 	(pattern 
             (node 'h :label "Hello"))
   :create	(pattern 
             (node 'w :label "World")
             (edge :src 'h :tar 'w :label "to")))

(rule 'vine 
   :read 	(pattern 
             (node 'h :label "Hello")
             (node 'w :label "World")
             (edge 'e :src 'h :tar 'w :label "to"))
   :delete ['w 'e]
   :create	(pattern 
             (node 'g :label "Grape")
             (edge :src 'h :tar 'g :label "to")))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"243\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2a741fa7 \"BufferedImage@2a741fa7: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f1529d8 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 243 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; As we can see, the rule visualization uses green colour for created elements, red colour for deleted elements and black colour for elements that are preserved. 
;;; 
;;; ## Rule applications
;;; Since graphs are immutable, any rule application to a graph produces a new graph. The following applies rule `hello` to a newly created (empty) graph.
;; **

;; @@
(hello (newgraph))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-string'>&quot;a825753e-310e-4a3f-8b70-c2aa1e54acff&quot;</span>","value":"\"a825753e-310e-4a3f-8b70-c2aa1e54acff\""}
;; <=

;; **
;;; Let's do this in two steps and by using local vars to refer to the graphs.
;; **

;; @@
(def g0 (newgraph))
(def g1 (hello g0))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/g1</span>","value":"#'user/g1"}
;; <=

;; **
;;; We can use `viewgraph` to view a graph. As expected, `g0` is empty, but `g1` contains a node.
;; **

;; @@
(viewgraph g0)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"149\" height=\"41\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2fa4db01 \"BufferedImage@2fa4db01: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@6f7eb837 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 149 height = 41 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(viewgraph g1)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"403\" height=\"91\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x5bdfc269 \"BufferedImage@5bdfc269: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f7eb837 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 403 height = 91 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; As can be expected, applying the second rule ('world') to 'g0' does not work, i.e., the rule does not find any matches in the empty graph. 
;; **

;; @@
(world g0)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; However, applying that rule to `g1` does indeed find a match and produce another graph.
;; **

;; @@
(viewgraph (world g1))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"409\" height=\"208\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4bdf32ad \"BufferedImage@4bdf32ad: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@6f7eb837 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 409 height = 208 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; For convenience, @@GRAPE@@ stores the graph that was generated by the most recent (successful) rule application in the special var **`_`** as a side-effect. So if we have just executed the above code (applying rule `world` to graph `g1`), we can try to apply another rule to the resulting graph by just using that var (see below):
;; **

;; @@
(viewgraph (vine _))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"401\" height=\"208\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3d466ba0 \"BufferedImage@3d466ba0: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@28dab2fe transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 401 height = 208 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; Instead of using nested functions, we can use the **_threading macro_** (**`->`**) to link our function executions. This makes for much clearner code with. (see below)
;; **

;; @@
(-> (newgraph) hello world vine viewgraph)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"401\" height=\"208\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7bd1288e \"BufferedImage@7bd1288e: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@6f7eb837 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 401 height = 208 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Graph processes and occurrences
;;; 
;;; As explained above, graph production rules are applied to graphs and are used to derive new graphs. This _derivation process_ is called a **graph process** where the nodes represent graphs and the edges represent **occurrences** of graph productions (rule applications).
;;; 
;;; For any graph, we can visualize the graph process it participates in with the `viewproc` form:
;; **

;; @@
(viewproc _)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"134\" height=\"407\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2ebdc49d \"BufferedImage@2ebdc49d: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f7eb837 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 134 height = 407 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; If we want a detailed view of the occurrence that led to the derivation of a particular graph, we can use the `viewocc` form:
;; **

;; @@
(viewocc _)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"277\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6f0312fe \"BufferedImage@6f0312fe: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f7eb837 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 277 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; ## Tagging graphs of interest
;;; 
;;; Identifying graphs by unintelligable labels is inconvenient. Graphs can be tagged with semantic names using the `commit` form. In the following example, we tag the resulting graph with the name "_mygraph_"
;;; 
;;; 
;; **

;; @@
(-> (newgraph) hello world vine)
(commit _ "mygraph")
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-string'>&quot;1f891890-d469-49f5-87a0-aff0f3f87ec2&quot;</span>","value":"\"1f891890-d469-49f5-87a0-aff0f3f87ec2\""}
;; <=

;; **
;;; Once tagged, we can simply call the `graph` form to recall the graph by its semantic name, for example:
;; **

;; @@
(viewgraph (graph "mygraph"))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"169\" height=\"208\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x401b76b3 \"BufferedImage@401b76b3: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@6f7eb837 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 169 height = 208 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Rolling back uninteresting derivations
;;; We may want to roll back uninteresting graph derivations, for example to free up resources or to prune graph processes. We can do so by using the `rollback` form. **Warning**: calling rollback will remove all graphs that are not in the history of any _committed_ (tagged) graph.
;;; 
;;; The following example illustrates this behaviour. In the code block below, create a graph process with four different branches, originating from the same empty start graph. We commit a tag for the end-result of one of these derivations.
;; **

;; @@
(def start (newgraph))

(-> start hello world vine)
(-> start hello world vine)
(-> start hello world vine)
(-> start hello world vine)
(commit _ "my graph")
(viewproc start)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"568\" height=\"407\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x408df8dc \"BufferedImage@408df8dc: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f1529d8 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 568 height = 407 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Calling `rollback` will remove all graphs that "do not lead up to" a committed (tagged) graph in the graph process. (see below)
;; **

;; @@
(rollback)
(viewproc start)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"134\" height=\"407\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x71776b43 \"BufferedImage@71776b43: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f1529d8 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 134 height = 407 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=
